.section .text
.global _start
_start:
    # Initialize vector unit
    vsetivli x0, 4, e32, m1, ta, ma  # Use 4 lanes for demonstration (adjust based on hardware)

    call cnn
    la a0, result_class
    call printClassification
    j _finish

cnn:
    # Prologue
     # Prologue
    addi sp, sp, -16
    sw ra, 12(sp)
    sw s0, 8(sp)
    sw s1, 4(sp)
    sw s2, 0(sp)

    mv s0, a0      # s0 = base address of matrix
    mv s1, a1      # s1 = size N

    vsetivli t0, 4, e32, m1, ta, ma  # 4 lanes, 32-bit elements

    li t0, 0               # i = 0
    loop_i:
        li t1, 0           # j = 0
    loop_j:
        li t2, 0           # k = 0
    loop_k:
        # Initialize 4 accumulators
        vmv.v.x v0, zero   # For channels k..k+3
        
        li t3, 0           # m = 0
    loop_m:
        li t4, 0           # n = 0
    loop_n:
        # Calculate input position
        add t5, t0, t3     # xi = i + m
        add t6, t1, t4     # xj = j + n
        
        # Load input value (scalar)
        li a2, 28
        mul t5, t5, a2     # xi * 28
        add t5, t5, t6     # xi * 28 + xj
        slli t5, t5, 2     # *4
        la a2, X
        add t5, t5, a2
        flw ft1, 0(t5)     # ft1 = X[xi][xj][0]
        
        # Broadcast input to vector
        vfmv.v.f v4, ft1   # v4 = [X, X, X, X]
        
        # Load weights for 4 channels more efficiently
        # Calculate base address for W[k][m][n]
        li t5, 100            # 25*4 (stride between channels)
        mul a3, t2, t5        # k * 100 (base channel offset)		
        li a4, 20             # 5*4 (bytes per row)
        mul a4, t3, a4        # m * 20
        slli a5, t4, 2        # n * 4
        add a3, a3, a4
        add a3, a3, a5        # (k*100 + m*20 + n*4)
        la a5, W
        add a3, a5, a3        # Address of W[k][m][n]

        # Load weights with stride of 100 bytes between elements
        li a4, 100            # Stride = 100 bytes (distance between channels)
        vlse32.v v5, (a3), a4 # Load W[k][m][n], W[k+1][m][n], W[k+2][m][n], W[k+3][m][n]
            
        # Fused multiply-accumulate
        vfmacc.vv v0, v4, v5
        
        addi t4, t4, 1     # n++
        li t5, 5
        blt t4, t5, loop_n

        addi t3, t3, 1     # m++
        li t5, 5
        blt t3, t5, loop_m

        # Load biases as a vector
        slli a3, t2, 2     # k * 4
        la a5, b
        add a3, a5, a3
        vle32.v v6, (a3)   # Load 4 biases at once
        
        # Add biases
        vfadd.vv v0, v0, v6
        
        # ReLU
        vmv.v.x v7, zero
        vfmax.vv v0, v0, v7
        
        # Calculate output address
        li t5, 192         # 24*8
        mul t6, t0, t5     # i*192
        li t5, 8           # channel stride
        mul t5, t1, t5     # j*8
        add t6, t6, t5     # i*192 + j*8
        add t6, t6, t2     # +k
        slli t6, t6, 2     # *4
        la t5, Zk
        add t6, t5, t6
        
    # Store all 4 channels consecutively
        vse32.v v0, (t6)       # Stores v0[0:3] to Zk[i][j][k:k+3]
        
        addi t2, t2, 4     # Process 4 channels at a time
        li t5, 8
        blt t2, t5, loop_k

        addi t1, t1, 1     # j++
        li t5, 24
        blt t1, t5, loop_j

        addi t0, t0, 1     # i++
        li t5, 24
        blt t0, t5, loop_i


       #MAXPOOLING LAYER
    li t0, 0               # d = 0 (channel)
loop_d2:
    li t1, 0               # i = 0 (row)
loop_i2:
    li t2, 0               # j = 0 (column)
loop_j2:
    
    # maxVal = Zk[i*2][j*2][d]
    li t3, 192           # 24 rows * 8 channels
    slli t4,t1,1         #t4= i*2
    mul t4, t4, t3         #t4 = i*2 * 24*8 
    slli t5, t2, 1         # t5 = j*2
    li t6, 8               # 8 channels per pixel
    mul t5, t5, t6         # t5 = j*2 * 8
    add t4, t4, t5         # t4 = i*2*24*8 + j*2*8
    add t4, t4, t0         # t4 = i*2*24*8 + j*2*8 + d
    slli t4, t4, 2         # Convert to byte offset
    la t5, Zk
    add t5, t5, t4         # Address of Zk[i*2][j*2][d]
    
    # Load initial max values (4 channels)
    vle32.v v0, (t5)   # v0 = [Zk[i*2][j*2][d..d+3]]





  li t3, 0              # m = 0
loop_m2:
    li t4, 0          # n = 0
loop_n2:
    # Calculate index = x*24*8 + y*8 + d
    # x = i*2 + m
    slli t5, t1, 1    # t5 = i * 2
    add t5, t5, t3    # t5 = x = i*2 + m
    # Calculate = x*24*8 
    li t6, 192         # t6 = 24*8
    mul t6, t5, t6  # t6 = x * 24 * 8
    la t5, temp0
    sw t6, 0(t5)        #temp0 = x * 24 * 8

    # y = j*2 + n
    slli t5, t2, 1     # t5 = j*2
    add t5, t5, t4     # t5 = y = j*2 + n
    li a2, 8
    mul t5, t5, a2     # t5 = y*8

    add t6, t6, t5     # t6 = x*24*8 + y*8
    add t6, t6, t0     # t6 = x*24*8 + y*8 + d
    slli t6, t6, 2     # Byte offset
    la t5, Zk
    add t5, t5, t6     # t5 = Address of Zk[x][y][d..d+3]

    # Load value from memory: val = Zk[x][y][d]
    vle32.v v1, (t5)   # v1 = [Zk[x][y][d..d+3]]

    # maxVal = max(maxVal, val)
    vfmax.vv v0, v0, v1  # v0 = max(v0, v1) element-wise

    # n++
    addi t4, t4, 1
    li t6, 2
    blt t4, t6, loop_n2

# m++
addi t3, t3, 1
li t6, 2
blt t3, t6, loop_m2


    # Store maxVal to A[i][j][d]
    li t5, 96                 # 12 * 8 = 96
    mul t5, t1, t5         # t5 = i * 96

    li t6, 8                  # 8 channels per pixel
    mul t6, t2, t6         # t6 = j * 8

    add t5, t5, t6   # t5 = i * 96 + j * 8
    add t5, t5, t0      # t5 = i * 96 + j * 8 + d

    slli t5, t5, 2      # convert to byte offset ( * 4) 

    la t4, A                  # base address of A
    add t5, t5, t4      # t5 = A[i][j][d]

    vse32.v v0, (t5)   # Store 4 max values

    addi t2, t2, 1           # j++
    li t5, 12
    blt t2, t5, loop_j2

    addi t1, t1, 1           # i++
    li t5, 12
    blt t1, t5, loop_i2

    addi t0, t0, 4     # Process next 4 channels
    li t5, 8
    blt t0, t5, loop_d2
    


    #FLATTENING A
   
    li t0, 0              # i = 0
    li t4, 0              # t4 = index = 0

loop_i_flat:
    li t1, 0              # j = 0
loop_j_flat:
    li t2, 0              # k = 0
loop_k_flat:
    # Compute A[i][j][k] address offset = ((i * 12 + j) * 8 + k) * 4 (float size)

    li t5, 12
    mul t6, t0, t5  #t6 = i*12 
    add t6, t6, t1  #t6 = i*12+j
    li t5, 8
    mul t6, t6, t5   #t6 = (i*12+j) *8
    add t6, t6, t2  #t6 = ((i * 12 + j) * 8 + k) 
    slli t6, t6, 2  # t6 = A[i][j][k] address offset = ((i * 12 + j) * 8 + k) * 4

    # Load float from A[i][j][k]
    la t5,A
    add t6, t5, t6
    # Vector load 4 consecutive channels
    vle32.v v0, (t6)   # v0 = [A[i][j][k], A[i][j][k+1], A[i][j][k+2], A[i][j][k+3]]

    # Store into flattenedA[index]
    slli t5, t4, 2
    la t6,flattenedA
    add t6, t6, t5
    # Vector store to flattened array
    vse32.v v0, (t6)   # store 4 elements at once

    # index++
    addi t4, t4, 4     # increment index by 4
    addi t2, t2, 4     # increment k by 4
    li t5, 8
    blt t2, t5, loop_k_flat

    addi t1, t1, 1       # j++
    li t5, 12
    blt t1, t5, loop_j_flat

    addi t0, t0, 1       # i++
    li t5, 12
    blt t0, t5, loop_i_flat



# DENSE LAYER 
    li t0, 0              # i = 0 
outer_loop:
    # Load bias Bfc[i]
    la t5, Bfc
    slli t2, t0, 2
    add t2, t5, t2
    flw ft0, 0(t2)        # ft0 = Bfc[i]
    vfmv.v.f v1, ft0      # Initialize accumulator with bias

    li t1, 0              # j = 0 
inner_loop:
    li t6, 1152
    bge t1, t6, done_inner

    # Load weights Wfc[i][j..j+3]
    li t5, 1152
    mul t4, t0, t5        # i * 1152
    add t4, t4, t1        # i * 1152 + j
    slli t4, t4, 2        # byte offset
    la t5, Wfc
    add t5, t5, t4        # address of Wfc[i][j]
    vle32.v v3, (t5)      # v3 = [Wfc[i][j], Wfc[i][j+1], Wfc[i][j+2], Wfc[i][j+3]]

    # Load inputs flattenedA[j..j+3]
    slli t2, t1, 2        # byte offset
    la t3, flattenedA
    add t2, t3, t2        # address of flattenedA[j]
    vle32.v v2, (t2)      # v2 = [flattenedA[j], flattenedA[j+1], flattenedA[j+2], flattenedA[j+3]]

    # Fused multiply-accumulate
    vfmacc.vv v1, v2, v3  # v1 += v2 * v3

    addi t1, t1, 4        # j += 4
    j inner_loop

done_inner:
    # Reduce vector sum to scalar
    vfredsum.vs v1, v1, v1  # v1[0] = sum(v1[0..3])
    vfmv.f.s ft0, v1        # ft0 = total sum

    # Store Z[i]
    slli t2, t0, 2          # byte offset
    la t3, Z
    add t3, t3, t2          # address of Z[i]
    fsw ft0, 0(t3)

    addi t0, t0, 1          # i++
    li t6, 10
    blt t0, t6, outer_loop



#SOFTMAX LAYER

 
    la t4, Z
    vsetivli x0, 4, e32, m1, ta, ma
    vle32.v v0, (t4)
    vfredmax.vs v0, v0, v0
    vfmv.f.s f0, v0

    addi t4, t4, 16
    vle32.v v1, (t4)
    vfredmax.vs v1, v1, v1
    vfmv.f.s f1, v1
    fmax.s f0, f0, f1

    addi t4, t4, 16
    vsetivli x0, 2, e32, m1, ta, ma
    vle32.v v2, (t4)
    vfredmax.vs v2, v2, v2
    vfmv.f.s f2, v2
    fmax.s f0, f0, f2

    vsetivli x0, 4, e32, m1, ta, ma
    vfmv.v.f v3, f0                  # Broadcast max_Z

    fmv.s.x f6, zero                 # sum_exp = 0.0
    li t6, 0x3f800000                # 1.0
    vmv.v.x v10, t6                  # Constant 1.0 vector

    la t4, Z                         
    la t5, probs                     
    li t0, 0                         # i = 0

exp_loop:
    li t1, 10
    sub t2, t1, t0                   # Remaining elements
    li t3, 4
    blt t2, t3, exp_tail             

    # Process 4 elements
    vle32.v v4, (t4)
    vfsub.vv v5, v4, v3              # x = Z - max_Z

    # Taylor series (10 terms)
    vmv.v.v v6, v10                  # exp_val = 1.0
    vmv.v.v v7, v10                  # term = 1.0
    li a0, 1                         # j = 1

taylor_loop:
    vfmul.vv v7, v7, v5              # term *= x
    fcvt.s.w ft0, a0                 # Convert j to float
    vfmv.v.f v8, ft0                 # Broadcast j
    vfdiv.vv v7, v7, v8              # term /= j
    vfadd.vv v6, v6, v7              # exp_val += term

    addi a0, a0, 1
    li a1, 10
    blt a0, a1, taylor_loop

    # Store and accumulate
    vse32.v v6, (t5)
    vmv.v.x v11, zero                
    vfredusum.vs v11, v6, v11        # Partial sum
    vfmv.f.s ft0, v11
    fadd.s f6, f6, ft0               # sum_exp += partial_sum

    # Update pointers
    addi t4, t4, 16
    addi t5, t5, 16
    addi t0, t0, 4
    j exp_loop

exp_tail:
    # Handle remaining elements (1-3)
    vsetivli x0, 2, e32, m1, ta, ma # Set VL to actual remaining
    vle32.v v12, (t4)                
    vfsub.vv v13, v12, v3

    # Taylor series for tail
    vmv.v.v v14, v10                 # exp_val
    vmv.v.v v15, v10                 # term
    li a0, 1                         # j = 1

taylor_tail_loop:
    vfmul.vv v15, v15, v13           # term *= x
    fcvt.s.w ft0, a0                 # j as float
    vfmv.v.f v16, ft0                # Broadcast j
    vfdiv.vv v15, v15, v16           # term /= j
    vfadd.vv v14, v14, v15           # exp_val += term

    addi a0, a0, 1
    li a1, 10
    blt a0, a1, taylor_tail_loop

    # Store and accumulate tail
    vse32.v v14, (t5)
    vmv.v.x v17, zero                
    vfredusum.vs v17, v14, v17       # Partial sum
    vfmv.f.s ft0, v17
    fadd.s f6, f6, ft0

    #Normalization 
    vsetivli x0, 4, e32, m1, ta, ma
    vfmv.v.f v9, f6                  # Broadcast sum_exp
    la t5, probs
    li t0, 0

norm_loop:
    li t1, 10
    sub t2, t1, t0                   # Remaining elements
    li t3, 4
    blt t2, t3, norm_tail

    # Process 4 elements
    vle32.v v18, (t5)
    vfdiv.vv v18, v18, v9            # Normalize
    vse32.v v18, (t5)

    addi t5, t5, 16
    addi t0, t0, 4
    j norm_loop

norm_tail:
    # Handle remaining elements (1-3)
    vsetivli x0, 2, e32, m1, ta, ma # Set VL to actual remaining
    vle32.v v19, (t5)
    vfdiv.vv v19, v19, v9
    vse32.v v19, (t5)

softmax_done:


#CLASSIFY

    li t0, 0                  # predicted_class = 0
    li t1, 1                  # i = 1

classify_loop:
    li t2, 10
    bge t1, t2, classify_done

    # Load probs[i] into f1
    slli t3, t1, 2            # byte offset = i * 4
    la t4,probs
    add t4, t4, t3
    flw f1, 0(t4)       #f1 = prob[i]

    # Load probs[predicted_class] into f2
    slli t3, t0, 2            # byte offset = predicted_class * 4
    la t5,probs
    add t5, t5, t3
    flw f2, 0(t5)       #f2 = probs[predicted_class]

    # if (f1 > f2)
    flt.s t6, f1, f2   #t6 = 1 if probs[i] < probs[predicted_class]
    beqz t6, dont_update

    # predicted_class = i
    mv t0, t1

dont_update:
    addi t1, t1, 1
    j classify_loop

classify_done:
    
    mv a0, t0                 # return predicted_class in a0
    la t1,result_class
    sw t0,0(t1)

    # Epilogue
    lw ra, 12(sp)
    lw s0, 8(sp)
    lw s1, 4(sp)
    lw s2, 0(sp)
    addi sp, sp, 16
    ret
